import React, { useState } from "react";
import {
  Container,
  Flex,
  FlexItem,
  FlexCentered
} from "../styles/general/General.styled";
import { SignUpImage, TextField, MuiBtn } from "../styles/SignInOut.styled";
import Navbar from "./general/Navbar";
import { Form, Formik } from "formik";
import VisibilityIcon from "@mui/icons-material/Visibility";
import VisibilityOffIcon from "@mui/icons-material/VisibilityOff";
import IconButton from "@mui/material/IconButton";
import InputAdornment from "@mui/material/InputAdornment";

const SignInOut = () => {
  const initialValues = {
    firstName: "",
    lastName: "",
    email: "",
    password: "",
    passwordConfirm: ""
  };

  const [showPw, setShowPw] = useState(false);
  const [showConfirmPw, setShowConfirmPw] = useState(false);

  return (
    <>
      <Navbar />
      <Container
        p="10rem 4rem"
        mh="100vh"
        bgColor="rgba(224, 247, 250, 0.8)"
        h="60%">
        <Flex bgColor="#f3e5f5" h="60vh" br="6rem">
          <FlexItem fg="1" h="60vh">
            <SignUpImage />
          </FlexItem>
          <FlexItem w="75%">
            <FlexCentered>
              <Formik
                initialValues={initialValues}
                onSubmit={(values, { setSubmitting, resetForm }) => {
                  setTimeout(() => {
                    setSubmitting(false);
                    // dispatch(registerUser(values));
                    resetForm();
                  }, 1500);
                }}>
                {({ values, errors, isSubmitting }) => (
                  <Form>
                    <Flex>
                      <TextField
                        label="First Name"
                        name="firstName"
                        type="input"
                      />
                      <TextField
                        label="Last Name"
                        name="lastName"
                        type="input"
                      />
                      <TextField
                        label="Email Address"
                        name="email"
                        type="email"
                      />
                      <TextField
                        name="password"
                        label="Password"
                        type={showPw ? "text" : "password"}
                        className="passwordField"
                        InputProps={{
                          endAdornment: (
                            <InputAdornment position="end">
                              <IconButton onClick={() => setShowPw(!showPw)}>
                                {showPw ? (
                                  <VisibilityOffIcon />
                                ) : (
                                  <VisibilityIcon />
                                )}
                              </IconButton>
                            </InputAdornment>
                          )
                        }}
                      />
                      <TextField
                        id="passwordConfirm"
                        name="passwordConfirm"
                        label="Confirm Password"
                        type={showConfirmPw ? "text" : "password"}
                        className="passwordField"
                        InputProps={{
                          endAdornment: (
                            <InputAdornment position="end">
                              <IconButton
                                onClick={() =>
                                  setShowConfirmPw(!showConfirmPw)
                                }>
                                {showConfirmPw ? (
                                  <VisibilityOffIcon />
                                ) : (
                                  <VisibilityIcon />
                                )}
                              </IconButton>
                            </InputAdornment>
                          )
                        }}
                      />
                      <MuiBtn
                        type="submit"
                        variant="contained"
                        color="primary"
                        disabled={isSubmitting}>
                        Sign Up
                      </MuiBtn>
                      {/* <pre>{JSON.stringify(values, null, 2)}</pre>
                <pre>{JSON.stringify(errors, null, 2)}</pre> */}
                    </Flex>
                  </Form>
                )}
              </Formik>
            </FlexCentered>
          </FlexItem>
        </Flex>
      </Container>
    </>
  );
};

export default SignInOut;
